import {Tabs, Tab, Link} from '@material-ui/core'



function DeskTopView() {
  return (
    <div>
// <Tabs
        value={0}
      >
        <Tab label="home" />
        <Link href="#about" color="inherit"><Tab label="about" /></Link>
        <Tab label="projects" />
        <Tab label="blog" />
        <Link href="#contact" color="inherit"><Tab label="contacts" /></Link>

      </Tabs>
    </div>

  )
}

export default DeskTopView
